import React from "react";
import { Link } from 'react-router-dom';
import { Navbar, Nav, Form, FormControl, Button } from 'react-bootstrap';
import NgonserLogo from './img/ngonserlogo.png'


class navbar extends React.Component {
    render() {
        return (
            <Navbar bg="primary" variant="dark">
                <Navbar.Brand href="#home">
                    <img
                        alt="Ngonser logo"
                        src={NgonserLogo}
                        height="35"
                        className="d-inline-block align-top"
                    />
                </Navbar.Brand>
                <Form inline>
                    <FormControl type="text" placeholder="Cari" className="mr-sm-2"/>
                </Form>

                <Nav className="ml-auto"> {/* Changed from separate Nav components to a single Nav component */}
                    <Nav.Link href="#tentang">Tentang Kita</Nav.Link>
                    <Nav.Link href="#hubungi">Hubungi Admin</Nav.Link>
                    <Nav.Link className="ml-auto" href="#masuk">Masuk</Nav.Link> {/* Added ml-auto class */}
                    <Nav.Link href="#daftar">Daftar</Nav.Link>
                </Nav>
            </Navbar>
        );
    }
}

export default navbar;
